INSERT INTO `news` VALUES
(10001, 1, 'Launch of New Management System', 'AgriHire Solutions is excited to announce the launch of our new Equipment and Order Management System. This advanced platform replaces our old Excel and paper-based processes, featuring a user-friendly homepage for product showcasing, efficient order management, and seamless payment processing.', '2024-06-06 10:00:00', 1),(10002, 11, 'System Upgrade at Branch 2', 'Our Branch 2 has successfully transitioned to the new Equipment and Order Management System. This upgrade introduces enhanced inventory control, comprehensive reporting, and streamlined administrative functions to better serve our small scale farmers and lifestyle block owners.', '2024-06-07 09:30:00', 1),(10003, 13, 'Feedback Session Scheduled', 'We value your feedback! Join us at Branch 3 on July 1st for a session discussing our new Equipment and Order Management System. Share your thoughts on how we can further improve your experience.', '2024-06-08 14:00:00', 1),(10004, 1, 'Training Completed at Multiple Branches', 'Our teams at Branches 4, 5, and 6 have completed their training on the new Equipment and Order Management System. Equipped with knowledge and tools, they are ready to assist you with all your needs.', '2024-06-09 11:00:00', 1),(10005, 13, 'National Rollout Achieved', 'We are proud to announce that all 18 stores nationwide have now implemented our new Equipment and Order Management System. AgriHire Solutions is fully equipped to offer our customers an enhanced service experience.', '2024-06-10 08:00:00', 1);
/*!40000 ALTER TABLE `news` ENABLE KEYS */;
UNLOCK TABLES;

