INSERT INTO `product` VALUES ('CHAIN-40HYD','CHAIN','Chainsaw - 400MM 16IN Hydraulic','This high powered hydraulic chainsaw is capable of cutting reinforced concrete to a maximum depth of 350mm. Makes flush cuts and square cutting easy and features a wet cutting system. ','Height 175mm * Length 950mm * Motor Hydraulic 40LPM * Oil Flow 40 Ltr/min * Weight 12.5kg (chainsaw) * Width 200mm',180.00,0,100.00,168,50.00,600,1,90,'Chainsaw - 400MM 16IN Hydraulic.jpg',1),('CHAIN-40PTR','CHAIN','Chainsaw - Petrol 400MM 16IN','Professional 2 stroke chainsaw with a powerful motor suitable for use in remote locations. Ideal for cutting firewood, tree lopping and trimming.','Height 175mm * Length 650mm * Motor Two-stroke, mix ratio 25:1 * Weight 9.8kg * Width 200mm',25.00,0,12.00,168,6.00,600,1,90,'Chainsaw - Petrol 400MM 16IN.jpg',1),('CHAIN-45PTR','CHAIN','Chainsaw - Petrol 450MM 18IN','Power through your outdoor tasks with a reliable battery chainsaw. Cordless convenience, eco-friendly performance, and long-lasting power make it your go-to tool for effortless cutting and pruning.','Bar Length 450 mm * Motor 2-Stroke fuel * Weight 7.5 kg',30.00,0,15.00,168,7.00,600,1,90,'Chainsaw - Petrol 450MM 18IN.jpg',1),('CMIX-BRW006','CMIX','Concrete Mixer - 0.06 cu.mtr (2 cu.ft) Barrow','A handy 240V electric powered concrete mixer ideal for smaller building projects. Can double as both a mixer and wheel barrow all in one with a 2 cu ft. capacity. Use on the stand provided or remove and use to mix and barrow the mixture into place.','Height 890mm off stand * Length 1211mm off stand * Weight 71.9kg* Width 597mm off stand',18.00,0,10.00,168,5.00,600,1,90,'Concrete Mixer - 0.06 cu.mtr (2 cu.ft) Barrow.jpg',1),('CMIX-PTR01','CMIX','Concrete Mixer - 0.1 cu.mtr (3 cu.ft) Petrol','A handy 4-Stroke petrol powered concrete mixer ideal for smaller building projects that is mounted on wheels for ease placement on site.','Weight 110kg',18.00,0,10.00,168,5.00,600,1,90,'Concrete Mixer - 0.1 cu.mtr (3 cu.ft) Petrol.jpg',1),('CMIX-PTR01T','CMIX','Concrete Mixer - 0.1 cu.mtr (3 cu.ft) Petrol Towable','A handy 4-Stroke petrol powered concrete mixer ideal for smaller building projects. Trailer mounted for easy transport to and from site.','Weight 179kg',20.00,0,9.00,168,4.00,600,1,90,'Concrete Mixer - 0.1 cu.mtr (3 cu.ft) Petrol Towable.jpg',1),('EXCV-30T','EXCV','Excavator 30 to 39 Tonne','Excellent larger sized machine in both standard and zero tail swing.;Suitable for all types of excavation. Fitted with dozer blade and a;range of buckets available, most unit have other attachment options;available including breakers, grab buckets and post hole borers.','Weigth 39000kg',500.00,0,200.00,168,100.00,600,1,90,'Excavator 30 to 39 Tonne.jpg',1),('EXCV-TOW','EXCV','Excavator Towable','For those smaller jobs or where site access is difficult. Requires;more than 2 tonne towing capacity vehicle. Excavator is supplied with;or without trailer and includes digging and cleaning buckets. In some;regions a clay digging bucket is included.','Weigth 1500kg',90.00,0,45.00,168,20.00,600,1,90,'Excavator Towable.jpg',1),('EXCV-TOWTS','EXCV','Excavator Towable Standard Tail Swing','Quiet and emission-free while still delivering a powerful performance, this eco-friendly excavator are perfect for your construction projects. Experience quiet operation, reduced running costs, and a cleaner environment.','Weigth 1800kg',100.00,0,50.00,168,20.00,600,1,90,'Excavator Towable Standard Tail Swing.jpg',1),('LAWN-CDLES','LAWN','Lawn Dethatcher Cordless','A light-weight battery-powered, cordless scarifier with a 2-in-1 function and easy blade shift. The easily adjusted working depth, together with a powerful engine, efficiently remove matted thatch and moss from the lawn.','Length 1070mm * Width 610mm * Height 1010mm * Weight 19.5kg * Cutting Width 375mm * Cutting Height 1mm',30.00,0,15.00,168,7.00,600,1,90,'Lawn Dethatcher Cordless.jpg',1),('LAWN-COPTR','LAWN','Lawn Corer - Petrol','This corer is self propelled, designed to allow air into the root system. This process helps with watering and fertilising to promote rejuvenation.','Length 1020mm * Width 736mm * Height 710mm * Weight 131kg * Coverage 600mm W x 75mm D * Fuel Petrol * Motor 4-Stroke Petrol 3.5 hp',35.00,0,15.00,168,7.00,600,1,90,'Lawn Corer - Petrol.jpg',1),('LAWN-LTRM','LAWN','Lawn Mower - Line Trimmer Package','A light and compact lawn mower and line trimmer in the one package for mowing lawns and trimming the lawn edges.','',18.00,0,8.00,168,5.00,600,1,90,'Lawn Mower - Line Trimmer Package.jpg',1),('POSTHD-1MPC','POSTHD','Post Hole Digger - 1 Man Petrol Cantilever','A tough, manoeuvrable, petrol powered tool for boring up to 360mm diameter holes for piers, fence and retaining wall posts, effortlessly with only one person.','Motor 9HP (7KW) Robin Subaru motor4 stroke petrol\nWeight 80kg ',30.00,0,15.00,168,7.00,600,1,90,'Post Hole Digger - 1 Man Petrol Cantilever.jpg',1),('POSTHD-1MS','POSTHD','Post Hole Digger - 1 Man Small','A light, hand held, petrol powered tool, ideal for boring up to 150mm diameter holes for fence post holes, planting shrubs or soil testing.','Operational Depth 600mm\nWeight 7kg ',25.00,0,10.00,168,5.00,600,1,90,'Post Hole Digger - 1 Man Small.jpg',1),('SPRA-ALSL','SPRA','Sprayer - Airless Large','This large airless sprayer is designed for efficient and even application of paint, stains, and other coatings. With a large capacity and adjustable pressure, it is ideal for both DIY and professional use.','Host Length 15mm * Weigth 35kg',60.00,0,30.00,168,15.00,600,1,90,'Sprayer - Airless Large.jpg',1),('SPRA-ALSPU','SPRA','Airless Spray Painting Unit','Used for applying paints over large areas inside and out. Advantages;of the airless unit is that you have less overspray and less refilling;due to the more economical application.','Weigth 14kg',10.00,0,7.00,168,5.00,600,1,90,'Airless Spray Painting Unit.jpg',1),('SPRA-BPTR','SPRA','Sprayer - Misting Backpack Petrol','A petrol powered backpack sprayer with an extensive coverage area for domestic & rural applications.','Length 980mm * Width 420mm * Height 620mm * Weigth 12.7kg',20.00,0,10.00,168,5.00,600,1,90,'Sprayer - Misting Backpack Petrol.jpg',1),('SPRA-KNPS','SPRA','Knapsack Sprayer','A lever pressurised back pack tank with domestic and rural applications including weed control.','Weigth 17kg',10.00,0,7.00,168,5.00,600,1,90,'Knapsack Sprayer.jpg',1),('TELEH-25','TELEH','Telehandler 2.5 Tonne/6.4m Lift ','Can be used with a variety of attachments including pallet forks,;crane jib or loader bucket. Telehandler is 4 wheel drive and 4 wheel;steer for working in confined areas.\"','Length 4905mm * Width 1984mm * Height 2096mm * Weigth 5350kg',110.00,0,75.00,168,50.00,600,1,90,'Telehandler 25.jpg',1),('TELEH-35','TELEH','Telehandler 3.5 Tonne/13.0m Lift','Can be used with a variety of attachments including pallet forks,;crane jib or loader bucket. Telehandler is 4 wheel drive and 4 wheel;steer for working in confined areas.\"','Length 5425mm * Width 2216mm * Height 2610mm * Weigth 8240kg',150.00,0,100.00,168,65.00,600,1,90,'Telehandler 35.jpg',1),('TELEH-40','TELEH','Telehandler 4.0 Tonne/17.0m Lift','Can be used with a variety of attachments including pallet forks,;crane jib or loader bucket. Telehandler is 4 wheel drive and 4 wheel;steer for working in confined areas.\"','Length 5790mm * Width 2400mm * Height 2510mm * Weigth 6000kg',200.00,0,150.00,168,80.00,600,1,90,'Telehandler 40.jpg',1),('TRAC-20HP','TRAC','Tractor - 20HP','General purpose tractor with applications that include aerating and topdressing with the appropriate attachments.','Length 2520mm * Width 1470mm * Height 2490mm * Weigth 875kg',75.00,0,30.00,168,15.00,600,1,90,'Tractor - 20HP.jpg',1),('TRAC-30HP','TRAC','Tractor Broom - 30HP','Road Sweeping unit ideal for road construction/ infrastructure project work.','Length 2640mm * Width 2130mm * Height 2150mm * Weigth 1560kg',150.00,0,75.00,168,35.00,600,1,90,'Tractor Broom - 30HP.jpg',1),('TRAC-45HP','TRAC','Tractor - 45HP','Heavy duty tractor with optional slasher attachment. Suitable for large areas of clearing and vegetation removal for farm and property use, as well as land and fire prevention preparation.','Length 1900mm * Width 1535mm * Height 2300mm * Weigth 1600kg',100.00,0,50.00,168,25.00,600,1,90,'Tractor - 45HP.jpg',1);
