e and retaining wall posts, effortlessly with only one person.',1),('PROMO-1008',13,10.00,'2024-06-02 00:00:00','2024-06-06 00:00:00',NULL,'Used for applying paints over large areas inside and out. Advantages;of the airless unit is that you have less overspray and less refilling;due to the more economical application.',1),('PROMO-1009',13,5.00,'2024-06-02 00:00:00','2024-06-12 00:00:00',NULL,'General purpose tractor with applications that include aerating and topdressing with the appropriate attachments.',1),('WINTERCS50',1,50.00,'2024-06-02 00:00:00','2024-07-15 23:59:59','Winter Chainsaw Mayhem','Limited time only! Get 50% off for this powerful chainsaw. Idea for cutting firewood, tree lopping and trimming in this Winter.',1);
